import React from 'react';
import { Link } from 'react-scroll';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="navbar-links">
        <li>
          <Link
            to="hero"
            smooth={true}
            duration={500}
            spy={true}          // This will automatically add the active class
            activeClass="active" // When the section is active in the viewport
            offset={-70}
          >
            Home
          </Link>
        </li>
        <li>
          <Link
            to="bio"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-70}
          >
            Bio
          </Link>
        </li>
        <li>
          <Link
            to="experience"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-70}
          >
            Experience
          </Link>
        </li>
        <li>
          <Link
            to="projects"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-70}
          >
            Projects
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
